export const ChatMessage = (props) => {
    const message=props.message;
    return (
        <div className="chat-message">
            <div className="chat-message-center">
                <div className="avatar">

                </div>
                <div className="message">
                    <strong>{message.message}</strong>
                </div>
            </div>

        </div>
    )
}
